            'X-RapidAPI-Host': 'shazam.p.rapidapi.com'
        }
    };
    
   await fetch('https://shazam.p.rapidapi.com/search?term=Romantic&locale=en-US&offset=0&limit=5', options)
        .then(response => response.json())
        .then(response =>{
            data = response;
        })
